import { useState, useEffect } from "react";
import StatsCards          from "./StatsCards";
import TicketList         from "./TicketList";
import TicketStatusPieChart from "./TicketStatusPieChart";
import PriorityBarChart     from "./PriorityBarChart";

export default function Dashboard() {
  const [period, setPeriod]   = useState("day");
  const [loading, setLoading] = useState(true);

  const [stats, setStats]           = useState({ total:0, closed:0, avgTime:0 });
  const [tickets, setTickets]       = useState([]);
  const [statusChart, setStatus]    = useState([]);
  const [priorityChart, setPriority]= useState([]);

  const [filters, setFilters] = useState({
    search: "", priority:"", status:"", project:"",
    assigned_person:"", dateFrom:"", dateTo:"", last_modified:""
  });

  useEffect(() => {
    setLoading(true);
    fetch(`/tickets-api/dashboard_stats.php?period=${period}`)
      .then(r=>r.json())
      .then(data=>{
        setStats(data.stats);
        setTickets(data.tickets);
        setStatus(data.statusChart);
        setPriority(data.priorityChart);
      })
      .finally(()=>setLoading(false));
  },[period]);

  const filtered = tickets.filter(t => {
    const term = filters.search.toLowerCase();
    return (
      (!filters.search ||
        t.incident_title.toLowerCase().includes(term) ||
        t.id.toString().includes(term)) &&
      (!filters.priority || t.priority_name===filters.priority) &&
      (!filters.status   || t.status===filters.status) &&
      (!filters.project  || t.project?.toLowerCase().includes(filters.project.toLowerCase())) &&
      (!filters.assigned_person ||
         t.assigned_person?.toLowerCase().includes(filters.assigned_person.toLowerCase())
      ) &&
      (!filters.dateFrom || new Date(t.start_date)>=new Date(filters.dateFrom)) &&
      (!filters.dateTo   || new Date(t.start_date)<=new Date(filters.dateTo)) &&
      (!filters.last_modified ||
         t.last_modified_date?.includes(filters.last_modified)
      )
    );
  });

  return (
    <div className="p-6">
      {/* periods */}
      <div className="flex justify-center gap-4 mb-8">
        {["day","week","month","year"].map(p=>(
          <button
            key={p}
            onClick={()=>setPeriod(p)}
            className={`px-4 py-2 text-sm rounded-full ${
              period===p ? "bg-blue-600 text-white"
                         : "bg-gray-300 dark:bg-gray-700 text-gray-800 dark:text-gray-300"
            }`}
          >
            {p==="day" ? "Azi" : p==="week" ? "Săptămână"
             : p==="month" ? "Lună" : "An"}
          </button>
        ))}
      </div>

      {/* KPIs */}
      <StatsCards stats={stats} />

      {/* charts */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-8">
        <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow">
          <h2 className="font-semibold mb-4">Status Tickete</h2>
          {loading ? <p>...</p> : <TicketStatusPieChart data={statusChart} height={300} />}
        </div>
        <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow">
          <h2 className="font-semibold mb-4">Tickete pe Prioritate</h2>
          {loading ? <p>...</p> : <PriorityBarChart data={priorityChart} height={300} />}
        </div>
      </div>

      {/* filters */}
      <div className="bg-white dark:bg-gray-800 p-6 rounded-lg shadow mb-8">
        <h2 className="font-semibold mb-4">Filtrare Avansată</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
          {/* reuse same inputs as in TicketList */}
          {/* ... */}
        </div>
      </div>

      {/* ticket list */}
      {loading
        ? <p className="text-center">Se încarcă...</p>
        : <TicketList tickets={filtered} />}
    </div>
  );
}
